import React, { Component, Fragment } from "react";
import { Link } from "react-router-dom";

import "./Footer.scss";

class Footer extends React.Component {
  state = {
    show: false
  };

  //ouvre/ferme la popup
  toggleDialog = () => {
    this.setState({ show: !this.state.show });
  };

  render() {
    return (
      <Fragment>
        <section class="site">
          <figure class="picteam">
            <p class="teamChoc">NOTRE TEAM DE CHOC</p>
            <img src={require("./img/brooke-cagle2.jpg")} class="pic" />
            <img src={require("./img/brooke-cagle2.jpg")} class="pic" />
            <img src={require("./img/brooke-cagle2.jpg")} class="pic" />
          </figure>
        </section>
        <footer>
          <ul>
            <li class="textfooter">
              <a href="">CONTACTEZ-NOUS</a>
            </li>
            <li class="textfooter">
              <a href="">QUI SOMMES-NOUS ?</a>
            </li>
            <li class="textfooter">
              <a href="">DEVENIR MEMBRE</a>
            </li>
            <li class="textfooter">
              <a href="">SERVICE CLIENT PROFESSIONNELS</a>
            </li>
            <li class="textfooter">
              <a href="">SERVICE CLIENT PARTICULIERS</a>
            </li>
            <li class="textfooter">
              <a href="">RETOURS</a>
            </li>
            <li class="textfooter">
              <a href="">GARANTIE D'AUTHENTICITE</a>
            </li>
            <li class="textfooter">
              <a href="">MENTIONS LEGALES</a>
            </li>
          </ul>
        </footer>
      </Fragment>
    );
  }
}

export default Footer;
